(611, 'Linda Kazaz', 'linda.easteu@koloxo.com', 'Collaboration', 'Dear Sirs,\r\n\r\nI am writing to you on behalf of Koloxo.com. I want to congratulate you, for the successful presentation of your products, and to invite you to work together on our international e-commerce platform.\r\n\r\nKoloxo.com is a fast-growing international B2C cross border multistore, e-commerce platform, helping thousands of businesses in the world to grow and reach their international and local clients.\r\n\r\nPlease allow me to explain a bit more regarding our proposition of collaboration:\r\n\r\nThere would be no minimum order quantity (MOQ), in each delivery as Koloxo.com doesn\'t keep stock in its warehouse. Our orders are based on the sold pieces, thought the platform of Koloxo.com\r\nWhen your product is purchased from Koloxos platform, our team will contact you to give you all the information regarding the order, and you will receive the full invoice amount for your product by Bank transfer, LiqPay, PayPal or Western Union before even your product leaves your warehouse. Then the courier will pick up the parcel from your warehouse. There would be no costs for your company at all. There are no hidden fees or taxes for the delivery. All logistics are on Koloxo.com\r\nI would like to add that the registration at Koloxo.com platform and the advertisement on the other channels are completely free. You can only benefit by uploading your products at the platform of Koloxo.com, as it will cost you nothing at all.\r\n\r\nWe can collaborate in two ways:\r\n\r\nFirst option: the factory/brand gives its fixed price, and Koloxo.com would add value, depending on the weight of your products. The weakness in that option is that the price can come too expensive to the final customer, as we are talking about cross-borders.\r\n\r\nSecond option: the factory/brand gives a discount on their catalog price.\r\n\r\nThe target of Koloxo.com is not in the Margin, but to bring your product to the final customer, at the approximate same price as the country of origin.\r\n\r\nRegarding what was said above, we strongly recommend choosing the second option, as this will not add additional costs to your products.\r\n\r\nWe will upload your products, and they will be visible on the platform of Koloxo.com, by two weeks counting from the moment we receive all the documents intended to be filled/signed by your company. This is the usual time for uploading new products on the platform, but this period may be shorter.\r\n\r\nOur agreement is quite simple and we are open to discuss and modifying any lines. We also can offer you the option to hide your products in different countries if this can cause any conflict with your representatives/if any.\r\n\r\nPlease do not hesitate to contact me if you require any further information/assistance\r\n\r\nI look forward to hearing from you\r\n\r\nKind regards\r\n\r\n--\r\n\r\nLinda Kazaz\r\nProcurement Manager\r\nEastern Europe & Middle East\r\nEmail: linda.easteu@koloxo.com\r\nURL: www.koloxo.com\r\n    https://youtu.be/QmsfTP6zVeo', '2020-04-03 06:02:29', '2020-04-03 06:02:29'),
