(16, 'Moisture Lock Shampoo for Dry Hair', ' ', '', '', 'This shampoo contains a unique blend of coconut, jojoba and essential oils of lavender, rosemary and thyme to deeply nourish and stimulate hair growth. Specially formulated for dry, damaged or chemically treated hair.\r\nSulphate, silicon and paraben free.', '    \r\n                          .', 'Apply to wet hair. Massage into scalp and hair working through the ends.Rinse thoroughly. \r\nFollow with conditioner. \r\n\r\nFor best results:\r\nRinse your hair and scalp with apple cider vinegar wash once a week to keep your scalp clean and remove old silicon build up on your hair.', 'Water(aqua), cocoamidopropyl betaine,glycerin, panthenol, wheat protein, cocos nucifera( coconut oil), jojoba oil, rosmarinus officinalis (rosemary extract),pelargonium graveolens (geranium extract), lavendula (lavendar extract),vitamin E, xanthan gum', '135', '0', 0, 2, 2, 1, 0, 0, 0, '', '5d3f1c6e82a777.41770752.png', NULL, 'moisture-lock-shampoo-for-dry-hair-16', '2019-04-20 10:35:13', '2020-01-30 06:27:11'),
(17, 'Hair Growth Serum', '  ', '', '', 'Bubblzz Hair Growth Serum contains a unique blend of 100% natural ingredients that stimulate hair growth and maintain a healthy scalp. Enriched with olive oil, coconut oil, castor oil, shea butter and jojoba oil and infused with essential oils of lavendar, rosemary, lemon and peppermint.', ' Bubblzz Hair Growth Serum       100         .                     .', 'Use daily to manage dry, frizzy hair. Can be applied before swimming to protect your hair from excessive exposure to pool and sea.\r\nFor hair growth, massage into scalp twice a week and leave for 2-3 hours to promote hair growth. Wash with shampoo and conditioner.\r\n100% safe for kids.', 'Olive oil, coconut oil, castor oil, shea butter, jojoba oil , essential oils of lavender, rosemary, lemon, peppermint and thyme.', '115', '0', 0, 2, 2, 0, 0, 0, 0, '', '5d592e3e9ac886.59129815.png', NULL, 'hair-growth-serum-17', '2019-04-20 10:42:03', '2020-05-11 12:27:27'),
(19, 'Shea Butter Hair Balm', '', '', '', 'This Sheabutter hair balm contains a unique blend of sheabutter, coconut oil, castor oil and olive oil . This product is fragrance free and smells of raw, nutty sheabutter.', '', 'Apply daily to tame frizzy hair and to moisturise dry, damaged hair.\r\nUse also before swimming to protect your hair from chlorine and sea water.\r\nContains no preservatives or fragrance, 100% natural and safe for kids.', 'Sheabutter, castor oil, olive oil, coconut oil.\r\nFragrance free.', '125', '0', 0, 2, 2, 0, 0, 0, 0, '', '5d3f25a609a403.74714820.png', NULL, 'shea-butter-hair-balm-19', '2019-04-20 10:45:57', '2019-12-16 09:23:58'),
(20, 'Bubblegum Sheabutter Body Scrub', '', '', '', 'Our Sheabutter & Sugar body scrub is loaded with shea butter and coconut oil to make sure your skin is super moisturised. Infused with sunflower oil, grape seed oil,wheat germ oil and sweet almond oil . Sugar will naturally exfoliate and remove old rough skin , leaving your skin supple and renewed. Scented in a sweet cocktail of candies, lollipops and bubblegum and will leave your skin fragranced for hours.', '', 'Apply to dry or wet skin in circular motions. Rinse well with water.', 'Sunflower seed oil, coconut oil, grape seed oil, sweet almond oil, wheat germ oil, beeswax, sugar, stearic acid, fragrance.', '150', '0', 0, 16, 3, 0, 0, 0, 0, '', '5d59396a99b454.23418290.png', NULL, 'bubblegum-sheabutter-body-scrub-20', '2019-04-20 10:52:24', '2019-12-16 09:23:58'),
(21, 'Berrylicious Sheabutter Body Scrub', '', '', '', 'Our Sheabutter& Sugar body scrub is loaded with sheabutter to make sure your skin is super moisturized. This one has a heavenly berrylicious scent! This fragrance captures the promise of sweet berries on a vine, just waiting to be picked, with blended notes of blueberries and raspberries.', '', 'Apply to dry or wet skin in circular motions. Rinse well with water.', 'Sunflower seed oil, coconut oil, grape seed oil, sweet almond oil, wheat germ oil, beeswax, sugar, stearic acid, fragrance.', '150', '0', 0, 16, 3, 0, 1, 0, 0, '', '5d5939559a6ab3.37639452.png', NULL, 'berrylicious-sheabutter-body-scrub-21', '2019-04-20 10:55:00', '2019-12-16 09:23:58'),
(23, 'Love Spell Soap', '', 'Net weight: 160gms', '', 'Fall in love with the scent of Love Spell Soap. Fragranced with a flowery bouquet of orchids, lavendar and roses.', '', 'Use like any normal bar of soap. Simply rub the bar repeatedly between wet hands until you form a lather to clean your skin with. Alternatively, rub the bar on a sponge.', 'Ingredients:\r\nCoconut Oil, Glycerin, Purified Water,  Stearic Acid, Fragrance, FD&C Colors.', '50', '0', 0, 11, 5, 0, 0, 0, 0, '', '5d2cd4d3e5fac6.45035945.png', NULL, 'love-spell-soap-23', '2019-04-20 17:01:57', '2020-04-26 11:54:11'),
(24, 'Milk, Oatmeal & Honey Soap', '', '', '', 'This soap is infused with milk, oatmeal and honey.These ingredients have anti-inflammatory and protective properties and provide many health benefits for numerous skin conditions such as acne, eczema or dry itchy skin. Gentle on your face with a nice creamy lather.\r\nIdeal for sensitive skin, eczema, and normal skin.\r\nSulfate and paraben free.', '', 'Using water, work into a lather and wash your face in circular motion. Rinse well with water.\r\nUse morning and evening for best results.', 'Coconut oil, glycerin, sorbitol, honey, oatmeal, milk, stearic acid.', '45', '0', 0, 10, 5, 0, 0, 0, 0, '', '5d2cd5488f2169.15896648.png', NULL, 'milk-oatmeal-honey-soap-24', '2019-04-20 17:04:12', '2020-04-26 11:53:24'),
(25, 'Cupcake SheaButter Body Scrub', '', '', '', 'Our Sheabutter& Sugar body scrub is loaded with sheabutter to make sure your skin is super moisturised. Scented with a yummy sweet , longlasting fragrance.', '', 'Apply to dry or wet skin in circular motions. Rinse well with water.', 'Sunflower seed oil, coconut oil, grape seed oil, sweet almond oil, wheat germ oil, beeswax, sugar, stearic acid, fragrance.', '150', '0', 0, 16, 3, 0, 0, 1, 0, '', '5d5939857b54f9.46304088.png', NULL, 'cupcake-sheabutter-body-scrub-25', '2019-07-14 05:48:33', '2019-12-16 09:23:58'),
(26, 'Coconut Sheabutter Body Scrub', '', '', '', 'Our Sheabutter& Sugar body scrub is loaded with sheabutter to make sure your skin is super moisturised. Infused with sunflower oil, grape seed oil,wheat germ oil and sweet almond oil . Sugar will naturally exfoliate and remove old rough skin , leaving your skin supple and renewed.The warm, summer scent will evoke images of the tropics, warm summer breeze and delicious coconuts', '', 'Apply to dry or wet skin in circular motions. Rinse well with water.', 'Sunflower seed oil, coconut oil, grape seed oil, sweet almond oil, wheat germ oil, beeswax, sugar, stearic acid, fragrance.', '150', '0', 0, 16, 3, 0, 0, 0, 0, '', '5d5937ee31d0e6.11844154.png', NULL, 'coconut-sheabutter-body-scrub-26', '2019-07-14 05:50:22', '2019-12-16 09:23:58'),
(27, 'Berrylicious Shower Gel', '', '', '', 'Enjoy the burst of fruity fragrance of our berrylicious shower gel.The strong fruity aroma brings to your mind fresh and luscious berries. This shower gel is infused with coconut oil, grape seed oil, panthenol and vitamin E to soften,tone and moisturise your skin.This body wash is free from chemicals like SLS, SLES and paraben making it ideal for daily use. It acts gently on your skin without harming it.', '', 'Squeeze a small amount into hand or into wet puff, work into a lather. Wash your skin then rinse with water.', 'Water(aqua), cocoglucoside, Cocoamidopropyl betaine, D-Panthenol, Coconut Oil, Glycerin, Sweet Almond Oil, Grape seed oil, Vitamin E, Fragrance.', '80', '0', 0, 15, 3, 0, 1, 0, 0, '', '5e1b23c6cbc8b1.17166545.png', NULL, 'berrylicious-shower-gel-27', '2019-07-14 06:17:56', '2020-01-12 11:48:54'),
(28, 'Coconut Shower Gel', '', '', '', 'Coconut shower gel is sheer indulgence! The warm, summer scent will evoke images of the tropics, warm summer breeze and delicious coconuts This shower gel is infused with coconut oil, grape seed oil, panthenol and vitamin E to soften,tone and moisturise your skin.This body wash is free from chemicals like SLS, SLES and paraben making it ideal for daily use. It acts gently on your skin without harming it.', '', 'Squeeze a small amount into hand or into wet puff, work into a lather. Wash your skin then rinse with water.', 'Water(aqua), cocoglucoside, Cocoamidopropyl betaine, D-Panthenol, Coconut Oil, Glycerin, Sweet Almond Oil, Grape seed oil, Vitamin E, Fragrance.', '80', '0', 0, 15, 3, 0, 0, 0, 0, '', '5e1aee622b0458.30587665.png', NULL, 'coconut-shower-gel-28', '2019-07-14 06:26:24', '2020-01-12 08:01:06'),
(29, 'Bubble Gum Shower Gel', '', '', '', 'Remember that bright pink bubble gum from childhood - the one with the sweet, tempting smell? This shower gel has the sweetest almost irresistible candy aroma.It is infused with coconut oil, grape seed oil, panthenol and vitamin E to soften,tone and moisturise your skin.This body wash is free from chemicals like SLS, SLES and paraben making it ideal for daily use. It acts gently on your skin without harming it.', '', 'Squeeze a small amount into hand or into wet puff, work into a lather. Wash your skin then rinse with water.', 'Water(aqua), cocoglucoside, Cocoamidopropyl betaine, D-Panthenol, Coconut Oil, Glycerin, Sweet Almond Oil, Grape seed oil, Vitamin E, Fragrance.', '80', '0', 0, 15, 3, 0, 0, 0, 0, '', '5e1aee42944883.39521763.png', NULL, 'bubble-gum-shower-gel-29', '2019-07-14 06:28:30', '2020-01-12 08:00:34'),
(30, 'Ocean Breeze Natural Deodorant', '', '', '', 'This deodorant is 100% natural. It is free from aluminium, paraben and propylene glycol. It will not prevent sweating , it will allow you to naturally sweat but will get rid of odour. This scent is clean, crisp and reminds you waves hitting the sandy beach.\r\n100% safe for children.', '', 'Apply to your armpits every six hours for best results. Discontinue use if you experience rash or sensitivity.', 'Sodium bicarbonate, cornstarch, water (aqua), coconut oil, jojoba oil, cetyl alcohol, cetearyl alcohol,  lavendar essential oil, fragrance.', '135', '0', 0, 17, 3, 0, 0, 0, 0, '', '5d593c628b6c91.24408070.png', NULL, 'ocean-breeze-natural-deodorant-30', '2019-07-14 06:40:28', '2019-12-16 09:23:58'),
