(42, 'Sheabutter & Lavendar  Soap', '', '', '', 'This soap is infused with moisturizing shea butter and calming lavender essential oil. Shea butter is well known for its anti-aging properties since it restores elasticity to skin.Lavender oil contains antioxidants that can help protect against wrinkles, fine lines, and dark age spots. \r\nSuitable for dry skin.', '', 'Use water and work well into a lather.  your face in circular motions. Rinse well with water.', 'Coconut oil, glycerin, sorbitol, sheabutter, lavendar esssential oil, stearic acid.', '45', '0', 0, 10, 5, 0, 0, 0, 0, '', '5d2ce12bbcbb68.24435270.png', NULL, 'sheabutter-lavendar-soap-42', '2019-07-15 18:25:15', '2020-04-27 06:01:15'),
(43, 'Watermelon Soap', '', 'Net weight: 160gms', '', 'This soap captures the essence of fresh, juicy, ripe watermelon. Infused with glycerin and very gentle on your skin.', '', 'Use like any normal bar of soap. Simply rub the bar repeatedly between wet hands until you form a lather to clean your skin with. Alternatively, rub the bar on a sponge.', 'Ingredients: Coconut Oil, Glycerin, Purified Water, Stearic Acid, Fragrance, FD&C Colors.', '45', '0', 0, 11, 5, 0, 0, 0, 0, '', '5d2d94797d3f98.04110112.png', NULL, 'watermelon-soap-43', '2019-07-16 07:08:08', '2020-04-27 06:00:30'),
(44, 'Olive Oil and Clay Soap', '', '', '', 'This soap is infused with bentonite clay which helps absorb excess oils fro your skin and detoxify and lean your pores. It also contains olive oil which mimics your skin\'s natural sebum, so it\'ll leave your skin barrier extra smooth and soft, \r\nRecommended for oily and combination skin.', '', 'Apply water and work well into a lather.wash your face in circular motions.Rinse well with water.', 'Coconut oi, olive oil, bentonite clay,sorbitol, glycerin, stearic acid.', '45', '0', 0, 10, 5, 0, 0, 0, 0, '', '5d2d9df762d1d1.64932977.png', NULL, 'olive-oil-and-clay-soap-44', '2019-07-16 07:15:06', '2020-04-26 11:49:17'),
(45, 'Oud Soap', '', '', '', 'This soap is fragranced with oud, a scent that opens with exotic rosewood and cardamon before giving way to a smoky blend of rare oud and sandalwood. Infused with glycerin to leave your skin supple and soft.', '', 'Use like any normal bar of soap. Simply rub the bar repeatedly between wet hands until you form a lather to clean your skin with. Alternatively, rub the bar on a sponge.', 'Ingredients: Coconut Oil, Glycerin, Purified Water, Stearic Acid, Fragrance, FD&C Colors.', '55', '0', 0, 11, 5, 0, 0, 0, 0, '', '5d2d9cbbc11363.43246889.png', NULL, 'oud-soap-45', '2019-07-16 07:24:43', '2020-04-27 05:59:40'),
(46, 'White Musk Soap', '', '', '', 'This soap is fragranced with a fresh, clean and velvety scent with musky, light, floral notes.Infused with glycerin to  cleanse your skin without over drying.', '', 'Use like any normal bar of soap. Simply rub the bar repeatedly between wet hands until you form a lather to clean your skin with. Alternatively, rub the bar on a sponge.', 'Ingredients: Coconut Oil, Glycerin, Purified Water, Stearic Acid, Fragrance, FD&C Colors.', '55', '0', 0, 11, 5, 0, 0, 0, 0, '', '5d2da8fe822363.89480272.png', NULL, 'white-musk-soap-46', '2019-07-16 07:56:49', '2020-04-27 06:00:00'),
