(101, 'Tanning Oil', '', '', '', 'A deliciously vanilla fragranced tanning oil with rich extracts of carrot oil, almond oil and jojoba oil to help lock in moisture and keep your skin hydrated and soft. This tanning oil provides a deep, sun kissed glow to your skin.', '', 'Apply liberally 15 min before exposure to sunlight. Reapply every 2 hours after swimming and towel drying.', 'Carrot oil, almond oil, jojoba oil, glycerin, ethyl hexyl methoxy cinammate, isopropyl palmitate, vitamin E, fragrance.', '110', '90', 0, 20, 3, 0, 0, 0, 0, '', '5d3f3093826590.22678396.png', NULL, 'tanning-oil-101', '2019-07-29 15:40:59', '2019-12-16 09:23:59'),
(102, 'Donut Soap', '', '', '', 'This soap looks good enough to eat! Fragranced with our best selling bubble gum fragrance. Enriched with glycerin and coconut oil and sulphate free. This soap ideal for cleansing without over drying.', '', 'Use like any normal bar of soap. Simply rub the bar repeatedly between wet hands until you form a lather to clean your skin with. Alternatively, rub the bar on a sponge.', 'Ingredients: Coconut Oil, Glycerin, Purified Water, Stearic Acid, Fragrance, FD&C Colors.', '50', '0', 0, 11, 5, 0, 0, 0, 0, '', '5d401e4d1a2944.82191936.png', NULL, 'donut-soap-102', '2019-07-30 07:56:18', '2020-04-26 11:48:09'),
(103, 'Rose Foot Scrub', '', '', '', 'This product is a soap with a loofah embedded inside. Ideally used in the shower to scrub away dead skin cells and reveal soft, supple skin. The soap is infused with rose essential oil for a calming and relaxing bath experience.', '', 'Apply water to the soap part of the loofah and work well into a lather. Scrub your body with the loofah part, rinse well with water.', 'Coconut oil, water(aqua),glycerin, sorbitol, natural loofah, stearic acid, rose essential oil.', '45', '0', 0, 16, 3, 0, 0, 0, 0, '', '5d40300c9916e0.54488383.png', NULL, 'rose-foot-scrub-103', '2019-07-30 09:29:55', '2020-04-30 10:33:30'),
(104, 'Peppermint Foot Scrub', '', '', '', 'Are you just back from work with aching feet?  Apply water and massage your feet and enjoy the refreshing strong smell of peppermint essential oil.Peppermint essential oil is also well known for its antibacterial properties making this product ideal as a foot scrub.', '', 'Apply water to the soap part of the loofah and work well into a lather. Scrub your body with the loofah part, rinse well with water.', 'Coconut oil, water(aqua),glycerin, sorbitol, natural loofah, stearic acid, peppermint essential oil.', '45', '0', 0, 16, 3, 0, 0, 0, 0, '', '5d4030f9510421.83109205.png', NULL, 'peppermint-foot-scrub-104', '2019-07-30 09:58:07', '2020-04-30 10:49:46'),
(105, 'Waffle Soap', '', '', '', 'You cannot take a bite into this soap!.Fragranced with a yummy chocolate vanilla scent. It is also enriched with glycerin and coconut oil and is sulphate free. This soap ideal for cleansing without over drying.', '', 'Use like any normal bar of soap. Simply rub the bar repeatedly between wet hands until you form a lather to clean your skin with. Alternatively, rub the bar on a sponge.', 'Ingredients: Coconut Oil, Glycerin, Purified Water, Stearic Acid, Fragrance, FD&C Colors.', '50', '0', 0, 11, 5, 0, 0, 0, 0, '', '5d403517954155.03441146.png', NULL, 'waffle-soap-105', '2019-07-30 10:13:43', '2020-04-27 06:00:51'),
(106, 'Bubble Gum Soap', '', '', '', 'This soap is scented with a sweet cocktail of candies, lollipops and bubblegum. Infused with coconut oil and glycerin to cleanse your skin without over drying.\r\nSulphate and paraben free.', '', 'Use like any normal bar of soap. Simply rub the bar repeatedly between wet hands until you form a lather to clean your skin with. Alternatively, rub the bar on a sponge.', 'Ingredients: Coconut Oil, Glycerin, Purified Water, Stearic Acid, Fragrance, FD&C Colors.', '50', '0', 0, 11, 5, 0, 0, 0, 0, '', '5d40471622aa64.63684856.png', NULL, 'bubble-gum-soap-106', '2019-07-30 11:20:52', '2020-04-26 11:47:07'),
(107, 'Cloud Bathbomb', '', '', '', 'This fruity scented Cloud bath bomb will fizz for up to 5 minutes while creating a lovely rainbow like stream of colour on top of your bath water!', '', 'Fill your bathtub with water and drop your bathbomb and watch it fizz and foam!', 'Citric Acid, Sodium Bicarbonate, Almond oil, Corn starch, Fragrance.', '55', '0', 0, 6, 6, 0, 0, 0, 0, '', '5d40488ce20f89.42723346.png', NULL, 'cloud-bathbomb-107', '2019-07-30 11:36:18', '2019-12-16 09:23:59'),
(108, 'Cupcake Shower Gel', '', '', '', 'This shower jel has a sweet irresistible fragrance.It is infused with coconut oil, grape seed oil, panthenol and vitamin E to soften,tone and moisturise your skin.This body wash is free from chemicals like SLS, SLES and paraben making it ideal for daily use. It acts gently on your skin without harming it.', '', 'Squeeze a small amount into your hand or into a wet puff, work into a lather. Wash your skin then rinse with water.', 'Water(aqua), cocoglucoside, Cocoamidopropyl betaine, D-Panthenol, Coconut Oil, Glycerin, Sweet Almond Oil, Grape seed oil, Vitamin E, Fragrance.', '80', '0', 0, 15, 3, 0, 0, 0, 0, '', '5e1c4f508349e6.89630189.png', NULL, 'cupcake-shower-gel-108', '2019-07-30 11:41:59', '2020-05-06 06:51:23'),
