(135, 'Moisture Lock  Shampoo For all Hair Types', '', '', '', 'Bubblzz Shampoo for normal and oily hair is available now! Sulphate, silicon and paraben free but specially formulated to cleanse your scalp properly without over drying.', '', 'Apply to wet hair. Massage into scalp and hair working through the ends.Rinse thoroughly. Follow with conditioner. For best results: Rinse your hair and scalp with apple cider vinegar wash once a week to keep your scalp clean and remove old silicon build up on your hair.', 'Water(aqua), decyl glucoside, sodium lauryl sarcosinate, cocamidopropyl betaine, rosemary extract, lavender extract, D-panthenol, polyquaternium7-, polyquaternium 10-, allantoin, coconut oil, jojoba oil, olive oil, behentrimonium chloride, monopropylene glycol, vitamin E, hydroxyl ethyl cellulose, guar hydroxy propyltrimonium choride, sodium benzoate, EDTA, hexylethyl palmitate, fragrance', '135', '0', 0, 2, 2, 0, 0, 0, 0, '', '5e8f27bc07d088.87197141.png', NULL, 'moisture-lock-shampoo-for-all-hair-types-135', '2020-01-29 11:21:18', '2020-04-09 11:48:44'),
